import React from "react";
import {img} from "./public/Homeimg.png";

function Home() {

    return(
        <>
        <div className="div-home">
        <h1>This is a Home page content</h1>
        <p>Hello welcome to home page module,provide to service regard product.</p>
        <img src={img}></img>
        </div>
        </>

    )
}
export default Home;
